import React, { useEffect, useState } from 'react';
import axios from 'axios';
import Slider from '@mui/material/Slider';
import { PieChart, Pie, Cell, Tooltip, Legend } from 'recharts';
import Recommendation from '../components/Recommendation';

const Dashboard = () => {
  const [profile, setProfile] = useState(null);
  const [error, setError] = useState('');
  const [investmentAmount, setInvestmentAmount] = useState(5000); // default ₹5000

  useEffect(() => {
    const fetchProfile = async () => {
      const token = localStorage.getItem('token');
      try {
        const res = await axios.get('http://localhost:5000/api/profile', {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        });
        setProfile(res.data);
      } catch (err) {
        setError(err.response?.data?.message || 'Failed to load profile');
      }
    };

    fetchProfile();
  }, []);

  const COLORS = ['#0088FE', '#00C49F', '#FFBB28', '#FF8042'];
  const investmentData = [
    { name: 'Stocks', value: investmentAmount * 0.4 },
    { name: 'Mutual Funds', value: investmentAmount * 0.3 },
    { name: 'Real Estate', value: investmentAmount * 0.2 },
    { name: 'Gold', value: investmentAmount * 0.1 },
  ];

  if (error) return <div>Error: {error}</div>;
  if (!profile) return <div>Loading profile...</div>;

  return (
    <div className="p-6 max-w-xl mx-auto">
      <h2 className="text-2xl font-bold mb-4">Welcome, {profile.name}!</h2>
      <p><strong>Monthly Income:</strong> ₹{profile.monthlyIncome}</p>
      <p><strong>Monthly Expenses:</strong> ₹{profile.monthlyExpenses}</p>
      <p><strong>Risk Appetite:</strong> {profile.riskAppetite}</p>
      <p><strong>Financial Goal:</strong> {profile.financialGoal}</p>
      <p><strong>Investment Horizon:</strong> {profile.investmentHorizon} years</p>

      <div className="mt-6">
        <h3 className="text-lg font-semibold mb-2">Adjust Investment Amount: ₹{investmentAmount}</h3>
        <Slider
          min={1000}
          max={100000}
          step={1000}
          value={investmentAmount}
          onChange={(e, val) => setInvestmentAmount(val)}
          aria-label="Investment Slider"
          valueLabelDisplay="auto"
        />
      </div>

      <div className="mt-8">
        <h3 className="text-lg font-semibold mb-2">Investment Distribution</h3>
        <PieChart width={400} height={300}>
          <Pie
            data={investmentData}
            cx={200}
            cy={150}
            labelLine={false}
            label={({ name, percent }) => `${name} ${(percent * 100).toFixed(0)}%`}
            outerRadius={100}
            fill="#8884d8"
            dataKey="value"
          >
            {investmentData.map((entry, index) => (
              <Cell key={`cell-${index}`} fill={COLORS[index % COLORS.length]} />
            ))}
          </Pie>
          <Tooltip />
          <Legend />
        </PieChart>
      </div>

      <div className="mt-8">
        <Recommendation profile={profile} investment={investmentAmount} />
      </div>
    </div>
  );
};

export default Dashboard;
